import { func } from 'prop-types'
import React from 'react'
import './ServiceIntro.css'

export default function ServiceIntro() {
    const services = [
        {id : 1, name : '건강 설문', description: '설문을 한다.'},
        {id : 2, name :'샐러드 추천', description: '샐러드를 추천한다'},
        {id : 3,name : '샐러드 구독', description : '샐러드를 구독한다'}
    ]
    const serviceFunctionList = services.map(e =>
        <div id = {e.id}>
            <h4>0{e.id}</h4>
            <h3>{e.name}</h3>
            <p>{e.description}</p>
        </div>
        );
    
    return (
        <ol id = 'serviceFunctions'>
            {serviceFunctionList}
        </ol>
    )
}
